INSERT INTO content_lang (`id_content_lang`, `content_id`, `language_id`, `title`, `navigation_title`, `body`, `body1`, `body2`, `body3`, `description`, `short_description`, `keywords`) VALUES (10, 2, 1, NULL, NULL, '<p><strong>Vriendekring Fatima Center VZW</strong><br />\r\n&nbsp;</p>\r\n\r\n<p>Vriendenkring Fatima Center VZW is a Belgian organization that is active for already 15 years. It supports actively 5 projects in Thailand. These projects are related to each other and share the following:</p>\r\n\r\n<ul>\r\n	<li>All projects focus on education of young people</li>\r\n	<li>Both proffesional training as general education ( social rights, women rights, basic health education, sex education and family planning, etc...) are offerred&nbsp;</li>\r\n	<li>The above is offered with a total respect for the human being, without any discrimination related to descent, religion or life history of the xomen</li>\r\n	<li>Focus on recoveery of the human dignity of the women</li>\r\n</ul>\r\n\r\n<p>The projects / training centers that are supported by our organization are:</p>\r\n\r\n<p>1. The Fatima Self Help Center in Bangkok. It was the first center supported by our VZW and has given namen to our organization.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL);
