INSERT INTO email (`id`, `name`, `subject`, `message`, `created`, `modified`, `status`, `deleted`) VALUES (7, 'invoice to pdf', 'Welcome to {site_name}', '<div id=\"page-wrap\" style=\"width: 750px; margin: 0 auto;\">\n<table border=\"0\" id=\"identity\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td style=\"border:none\">\n			<div id=\"logo\"><img alt=\"logo\" id=\"image\" src=\"{site_logo}\" /></div>\n			</td>\n			<td style=\"border:none;width:100px\">\n			<div class=\"textarea\" id=\"address\">\n			<h3>{site_name}</h3>\n\n			<p>{order_date}</p>\n\n			<p>{order_number}</p>\n			</div>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<div style=\"clear:both\">&nbsp;</div>\n\n<table id=\"customer\" style=\"width:100%;\">\n	<tbody>\n		<tr>\n			<td style=\"border:none;vertical-align:top\">\n			<div class=\"textarea\" id=\"customer-title\">\n			<h3>{user_name}</h3>\n\n			<p>{user_email}</p>\n\n			<p>{address1}</p>\n\n			<p>{house_number}</p>\n\n			<p>{city}</p>\n\n			<p>{country}</p>\n\n			<p>{zip_code}</p>\n			</div>\n			</td>\n			<td style=\"border:none;\"><span style=\"display:none\">&nbsp;</span></td>\n		</tr>\n	</tbody>\n</table>\n\n<div style=\"clear:both\">&nbsp;</div>\n\n<table id=\"items\">\n	<tbody>\n		<tr>\n			<th>NAME</th>\n			<th>Details</th>\n			<th>Price</th>\n			<th>Quantity</th>\n			<th>Total</th>\n		</tr>\n		<tr class=\"item-row\">\n			<td colspan=\"5\">{order_item}</td>\n		</tr>\n		<tr>\n			<td class=\"blank\" colspan=\"2\">&nbsp;</td>\n			<td class=\"total-line\" colspan=\"2\">Subtotal</td>\n			<td class=\"total-value\">\n			<div id=\"subtotal\">{total_amount}</div>\n			</td>\n		</tr>\n		<tr>\n			<td class=\"blank\" colspan=\"2\">&nbsp;</td>\n			<td class=\"total-line balance\" colspan=\"2\">Total</td>\n			<td class=\"total-value balance\">\n			<div class=\"due\">{total}</div>\n			</td>\n		</tr>\n	</tbody>\n</table>\n</div>\n<style type=\"text/css\">#page-wrap{\nfont: 14px/1.4 Georgia, serif;\n}\n\n#logo {  position: relative; margin-top: -41px; border: 1px solid #fff; max-width: 448px; max-height: 100px; overflow: hidden; }\n#logo img { width: 200px; height: 100px}\n#address { width: 250px; height: 150px; float: right;text-align:right }\n#address h3 {margin:0px;}\n#address p {margin:0px;color:#CCC;}\n#customer { overflow: hidden; }\n\n#customer-title { float: left; }\n#customer-title h3{ font-size: 18px; font-weight: bold; color:#CCC;margin:0px }\n#customer-title p{ margin:0px }\n\ntable { border-collapse: collapse; }\n#items { clear: both; width: 100%; margin: 30px 0 0 0;border-collapse: collapse; }\n#items th { background: #999;color:#000; padding:8px 5px}\n#items textarea { width: 80px; height: 50px; }\n#items tr.item-row td { border: 0; vertical-align: top;text-align:center;padding:8px 5px }\n#items td.description { width: 300px; }\n.item-row td{ background-color:#eee; }\n#items td.item-name { width: 175px; }\n#items td.description textarea, #items td.item-name textarea { width: 100%; }\n#items td.total-line { border-right: 0; text-align: right; }\n#items td.total-value { border-left: 0; padding: 10px; }\n#items td.total-value textarea { height: 20px; background: none; }\n#items td.balance {  }\n#items td.blank { border: 0; }\n\n#terms { text-align: center; margin: 20px 0 0 0; }\n#terms h5 { text-transform: uppercase; font: 13px Helvetica, Sans-Serif; letter-spacing: 10px; border-bottom: 1px solid black; padding: 0 0 8px 0; margin: 0 0 8px 0; }\n</style><!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\n<title>Untitled Document</title>\n</head>\n\n<body>\n</body>\n</html>\n', '1410165891', '1449155973', 1, 0);
